import React from "react";

export default function Header() {
  return (
    <div className="header">
      <ul>
        <li>HOME</li>
        <li>PROJECTS</li>
        <li>ABOUT</li>
        <li>CONTACT</li>
      </ul>
    </div>
  );
}
